import React from 'react';
import classes from './success.module.css';

function Success() {
  return (
    <div className={classes.conatiner}>
      <h2> Payment has been done Successfully</h2>
      <p> We are pending to fullfil your Order soon ...</p>
    </div>
  )
}

export default Success;
